drop table disease;
create table disease (
	id INT,
	disease_code VARCHAR(50),
	disease_name VARCHAR(1000),
	diagnosis_datetime DATE,
	patient_id INT,
	visit_id INT,
	PRIMARY KEY(id),
	CONSTRAINT fk_patient
	FOREIGN KEY(patient_id) 
	  REFERENCES patient(id),
	  CONSTRAINT fk_visit
	FOREIGN KEY(visit_id) 
	  REFERENCES visit(id)
);
COMMENT ON TABLE disease IS 'Contains ICD diagnoses for patients, most notably ICD-10 diagnoses.';
COMMENT ON COLUMN disease.id IS 'id is a unique identifier which specifies diagnosis.';
COMMENT ON COLUMN disease.disease_code IS 'disease_code contains the actual code corresponding to the diagnosis assigned to the patient for the given row.';
COMMENT ON COLUMN disease.disease_name IS 'The title fields provide a brief definition for the given diagnosis code in disease_code';
COMMENT ON COLUMN disease.diagnosis_datetime IS 'diagnosis_datetimed provides the date and time the patient was diagnosed';
COMMENT ON COLUMN disease.patient_id IS 'patient_id is a unique identifier which specifies an individual patient.';
COMMENT ON COLUMN disease.visit_id IS 'visit_id represents a single patientâ€™s admission to the hospital.';

